import React from 'react';

let timerForm = (props) => {
    return (
        <form>
            <div>
                <label>
                    Work Time:
                    </label>
                <div className="TimerForm">
                    <input type="number" required
                        name="workTime"
                        value={props.workTime}
                        onChange={props.handleChange}/>
                    <span> min</span>
                </div>
            </div>
        </form>
    )
}

export default timerForm;
